import React from 'react';
import "./Navbar.css";
import logo from "./comarca-logo-ok.png"

//BOOTSTRAP
//import "bootstrap/dist/css/bootstrap.min.css";

//import { Navbar, Button , Nav } from 'react-bootstrap';

function navbar() {
    return (
        <div>
            <img src="" alt="" />
            <div>
                <ul>
                    <li>Tienda</li>
                    <li>Talleres</li>
                    <li></li>
                </ul>
            </div>
        </div>
    );
};

export default navbar;

